        int T = scanner.nextInt();

        for (int t = 0; t < T; t++) {
            int N = scanner.nextInt();
            int[] S = new int[N];
            int[] A = new int[N];

            for (int i = 0; i < N; i++) {
                S[i] = scanner.nextInt();
                A[i] = scanner.nextInt();
            }

            System.out.println(solve(N, S, A) ? "Yes" : "No");
        }

        scanner.close();
    }

    static boolean solve(int N, int[] S, int[] A) {
        int x = 0;

        for (int i = 0; i < N; i++) {
            if (S[i] == 0) {
                // If Person 0's turn, they want to make x zero
                if (x != 0 && (x ^ A[i]) == 0) {
                    x = 0;
                }
            } else {
                // If Person 1's turn, they want to make x non-zero
                if (x == 0) {
                    x = A[i];
                }
            }
        }

        return x == 0;
    }
